import React from 'react';
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Grid from '@material-ui/core/Grid';
import './App.css';

function App() {
  return (
    <div className='container-fluid' className='App'>
     <container>
      <p className="heading" style={{alignContent:center}}>the global count of corono</p>
      <Grid container xs={12}>
        <Grid item xs={4} className='content'>
            corona count
        </Grid>
        <Grid item  className='image'>
          <img width='900' height="500" className='image' src="https://image.freepik.com/free-vector/online-doctor-isometric-medical-template_1284-25039.jpg"></img>
        </Grid>
      </Grid>
     </container>
    </div>
  );
}

export default App;
